import Layout from "../components/layout/layout";

function Dashboard() {
  const position = {
    container: "flex gap-3 p-4 w-full h-full",
    leftwrapper: "w-1/4 h-full",
    rightwrapper: "w-3/4 h-full",
  };
  const design = {
    container: "bg-gray-100",
    leftwrapper: "bg-white rounded-xl",
    rightwrapper: "bg-white rounded-xl",
  };

  return (
    <Layout>
      <div className={`${position.container} ${design.container}`}>
        <div className={`${position.leftwrapper} ${design.leftwrapper}`}></div>
        <div
          className={`${position.rightwrapper} ${design.rightwrapper}`}
        ></div>
      </div>
    </Layout>
  );
}

export default Dashboard;
